import React, { useState } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
import AppHeader from '/Users/nicolemerriman/Desktop/wanderlogixs-app/src/components/header.js'; // Update the path to your AppHeader component
import './itinerary.css'; // Ensure this points to your CSS file

function Itinerary() {
    const [events, setEvents] = useState([]);
    const [eventForm, setEventForm] = useState({
        destination: '',
        startDate: new Date(),
        startTime: '12:00', // Default start time
        endDate: new Date(),
        endTime: '12:00', // Default end time
        notes: ''
    });

    const handleInputChange = (e) => {
        setEventForm({ ...eventForm, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        const newEvent = {
            ...eventForm,
            id: Date.now(), // Simple unique ID
            startDate: new Date(eventForm.startDate + 'T' + eventForm.startTime),
            endDate: new Date(eventForm.endDate + 'T' + eventForm.endTime)
        };
        setEvents([...events, newEvent]);
        setEventForm({ destination: '', startDate: new Date(), startTime: '12:00', endDate: new Date(), endTime: '12:00', notes: '' });
    };

    return (
        <>
            <AppHeader />
            <div className='calendar-form-container'>
                <div className="calendar-header">
                    <div className="calendar-text">Your Itinerary</div>
                    <div className="underline"></div>
                </div>
                <form onSubmit={handleSubmit} className="trip-info-form">
                    <input
                        type="text"
                        name="destination"
                        value={eventForm.destination}
                        onChange={handleInputChange}
                        placeholder="Destination"
                    />
                    <input
                        type="date"
                        name="startDate"
                        value={eventForm.startDate.toISOString().split('T')[0]}
                        onChange={handleInputChange}
                    />
                    <input
                        type="time"
                        name="startTime"
                        value={eventForm.startTime}
                        onChange={handleInputChange}
                    />
                    <input
                        type="date"
                        name="endDate"
                        value={eventForm.endDate.toISOString().split('T')[0]}
                        onChange={handleInputChange}
                    />
                    <input
                        type="time"
                        name="endTime"
                        value={eventForm.endTime}
                        onChange={handleInputChange}
                    />
                    <textarea
                        name="notes"
                        value={eventForm.notes}
                        onChange={handleInputChange}
                        placeholder="Notes"
                    />
<button type="submit" className="btn trip-btn-primary submit" disabled={formState !== 'submit'}>
                  Submit
                </button>
                    <div className="trips-submit-container">
                <button type="submit" className="btn trip-btn-primary submit" disabled={formState !== 'submit'}>
                  Submit
                </button>
                <button type="button" className="btn trip-btn-secondary submit" onClick={handleEdit}>
                  Edit
                </button>
                <button type="button" className="btn trip-btn-secondary submit" onClick={handleCancel}>
                  Cancel
                </button>
              </div>
                </form>
                <div className="calendar-container">
                    <Calendar
                        onChange={(value) => setEventForm({ ...eventForm, startDate: value, endDate: value })}
                        value={eventForm.startDate}
                        className="react-calendar"
                        calendarType="US"
                        tileContent={({ date, view }) => view === 'month' && events.map((event) => {
                            const start = new Date(event.startDate);
                            const end = new Date(event.endDate);
                            if (date >= start && date <= end) {
                                return <div key={event.id} className="calendar-event">{event.destination}</div>;
                            }
                            return null;
                        })}
                    />
                </div>
            </div>
        </>
    );
}

export default Itinerary;
